window.bookSummaryJSON = "<p><b><i>Earth </i></b><b>is the epic conclusion to the YA Paranormal Romance series A Walker Saga.</b></p> <p>With Brace back by her side and the melding bond again secure, Abigail should be happier than ever. Right? Well, there's still that little rodent problem of hers. The Seventine.</p> <p>Six of the evil energy sucking entities are free and with the convergence fast approaching, there is no doubt that the final battle will be fought soon. All that stands between the Seventine and the end of the First World star-system is Abigail, the other half-Walker females and a gathering of races from across the worlds.</p> <p>Abigail has never had so much to lose, but when everything is on the line, you fight with everything you have. She will never give up. But in the end, will she be able to save everyone?</p>"; 
